import React, {useState} from 'react';
import UserList from "./Components/UserList";
import AddUser from "./Components/AddUser";

const intitailaData = [{
    userName: 'jack',
    age:5
}]
function App() {
    const [data, setData] = useState(intitailaData)
    const saveData = (uName, uAge) => {
       setData((prevList)=>{
           return [...prevList, {name:uName, age: uAge}];
       })
    }

  return (
    <div>
        <AddUser onSaveData={saveData} />
        <UserList users={[data]}/>
    </div>
  );
}

export default App;
